(self.webpackChunkdemo=self.webpackChunkdemo||[]).push([[40256],{40256:n=>{n.exports='<div tuiItemGroup>\n    <tui-items-with-more [linesLimit]="linesLimit">\n        <ng-container *ngFor="let chip of chips">\n            <label\n                *tuiItem\n                tuiChip\n                [appearance]="chip === selected ? \'accent\' : \'neutral\'"\n            >\n                {{ chip }}\n                <input\n                    appearance=""\n                    name="radio"\n                    tuiChip\n                    type="radio"\n                    [value]="chip"\n                    [(ngModel)]="selected"\n                />\n            </label>\n        </ng-container>\n\n        <ng-template\n            let-index\n            tuiMore\n        >\n            <button\n                appearance="neutral"\n                iconEnd="@tui.chevron-down"\n                size="s"\n                tuiChip\n                type="button"\n                class="more"\n                (click)="linesLimit = 100"\n            >\n                More {{ chips.length - index - 1 }}\n            </button>\n        </ng-template>\n    </tui-items-with-more>\n</div>\n'}}]);